renderHTML:
__ht__function(data, gv, cache) {if (!cache.htmlView) {
        var image = cache.htmlView = document.createElement('img');
        image.addEventListener('mousedown', function(e){e.preventDefault();}, false);
        image.layoutHTML = function() {
            gv.layoutHTML(data, image);
        };
    }
    cache.htmlView.src = data.a('imageURL');
    cache.htmlView.style.zIndex = data.a('zIndex');
    return cache.htmlView;}

width.func:
__ht__function(data, view) {
var image = ht.Default.getImage(data.a('imageURL'));
if (image && image.width) {
    return image.width;
}
return undefined;
}

